import {Box, Stack, Typography} from '@mui/material';

import Logo from  '../assets/images/Logo-1.png';
const Footer = () => {
  return (
    <Box mt="80px" bgcolor='#1B45CE'>
        <Stack gap="20px" alignItems="center" px="20px" pt="24px">
            <img src={Logo} alt="logo" width="200px" height="220px" />
            <Typography variant="h5" pb="40px" mt="20px">
              Made by <span aria-label="img">ðŸ‘¥</span> <a href="mailto:huyke.ht@gmail.com" target="_blank" rel="noopener noreferrer" style={{color:'#fefae0'}}> AIOT-SQUAD</a>
            </Typography>
        </Stack>
    </Box>
  )
}

export default Footer
